import React from 'react';
import "./Project.css";
import Zoom from 'react-reveal/Zoom';

function Projects(props) {
    const projects = props.data;
    return (
        <div>
            <Zoom left>
            {projects.map((project)=>{
                return(
                    <div className="card">
                        {project.head}
                    </div>
                );
            })}
            </Zoom>
        </div>
        );
}

export default Projects;
